import { useEffect, useState } from "react";
import classes from "./FetchData.module.css";

const FetchData = () => {
  const [isData, setIsData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((respose) => {
        return respose.json();
      })
      .then((data) => {
        setIsData(data);
        console.log(data);
      });
  }, []);

  return (
    <div>
      <section className={classes.section}>
        <input type="text" placeholder="Search" className={classes.input} />
      </section>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            <th>Mobile</th>
          </tr>
        </thead>
        {isData.map((data) => (
          <tbody>
            <tr key={data.id}>
              <td>{data.name}</td>
              <td>{data.username}</td>
              <td>{data.email}</td>
              <td>{data.phone}</td>
            </tr>
          </tbody>
        ))}
      </table>
    </div>
  );
};
export default FetchData;
